import React from "react";
import { DragDropContext } from "react-beautiful-dnd";

const Drag = () => {
  return (
    <div>
      <h1>Drag</h1>
      <DragDropContext>
        <ul className="characters">
          <li>1</li>
        </ul>
      </DragDropContext>
    </div>
  );
};

export default Drag;
